import React from "react";

const RightContainer = ({user}) => {

    return(
        <div className="right_container">
            <h3 className="login">{user && user.name}</h3>
            <p className="label">Логин</p>
            <p className="info">{user.name}</p>
            <p className="label">Почта</p>
            <p className="info">{user.mail}</p>
            <p className="label">Пароль</p>
            <p className="info">{user.password}</p>
        </div>
    )

}

export default RightContainer;
